## C. Noisy simulation

We consider noise characterized by $T_{2}^{*}$, the ergodic dephasing time of an individual spin, and by $\Delta^{J}$, the unitless exchange error. For fixed values of these parameters, we simulate evolution under the time-varying Hamiltonian

$$
\left.\begin{array}{rl}
H(t) & =\epsilon^{z} \sum_{i} S_{i}^{z}+\sum_{i j} J_{i j}(t) \mathbf{S}_{i} \cdot \mathbf{S}_{j} \\
& +\sum_{i} \delta_{i}^{z^{*}} S_{i}^{z}+\sum_{i j} \delta_{i j}^{J} J_{i j}(t) \mathbf{S}_{i} \cdot \mathbf{S}_{j}
\end{array}\right\} H_{\text {noise }}
$$

where $\epsilon^{z}$ is the constant Zeeman term (assuming no magnetic field gradients or g-factor variations between the spins), $\mathbf{S}_{i}\left(S_{i}^{z}\right)$ is the spin operator ( $z$ component) for spin $i$, and $J_{i j}(t)$ is the ideal schedule of exchange pulses between spins $i$ and $j$. Zeeman noise $\delta_{i}^{z^{*}}$ is sampled from the normal distribution $\mathcal{N}\left(0, \sigma=\sqrt{2} \hbar / T_{2}^{*}\right)$, and unitless exchange error $\delta_{i j}^{J}$ is sampled from $\mathcal{N}\left(0, \sigma=\Delta^{J}\right)$ for each quasi-static simulation shot. We consider the high magnetic field $(\sim \mathrm{mT})$ limit such that the impact of $\delta_{i}^{z^{*, *}}$ is negligible compared to $\delta_{i}^{z^{*}}$.

For each gate two-qubit gate, we simulate the pulse schedule as a unitary evolution of the 6 electron spins, and then compute its effect on the qubit subspace. The two-EO-qubit gate infidelity is calculated as the sum of leakage and unitary error within the qubit subspace. We calculate the average fidelity over 20 quasistatic instances, which we then use in the Stim simulations of the surface code described in the next section. Figure 9 shows the simulated infidelities of several operations for fixed values of $T_{2}^{*}$ and $\Delta^{J}$, showing that infidelity generally tends to increase with sequence duration as expected. LCCX appears to exhibit little increase in error with increasing sequence length, indicating some degree of built-in noise insensitivity, as observed in [32].
